import React, { Component } from 'react';
import { connect } from 'react-redux';

class FormDataDisplay extends Component {
  render() {
    // Recupere as informações do seu estado criado no Redux
    const { Nome, Email, Cpf, Endereco,
      Cidade, estado, Curriculo, Cargo, Descricao } = this.props;
    return (
      <div>
        <div>
          <header>
            <h2>Dados enviados</h2>
          </header>
        </div>
        <div className="div-dados-enviados">
          <h4>
            <p>
              { `Nome: ${Nome}`}
            </p>
          </h4>
          <h4>
            <p>
              { `Email: ${Email}` }
            </p>
          </h4>
          <h4>
            <p>
              {`CPF: ${Cpf}`}
            </p>
          </h4>
          <h4>
            <p>
              {`Endereço: ${Endereco}`}
            </p>
          </h4>
          <h4>
            <p>
              {`Cidade: ${Cidade}`}
            </p>
          </h4>
          <h4>
            <p>
              {`Estado: ${estado}`}
            </p>
          </h4>
          <h4>
            <p>
              {`Currículo: ${Curriculo}`}
            </p>
          </h4>
          <h4>
            <p>
              {`Cargo: ${Cargo}`}
            </p>
          </h4>
          <h4>
            <p>
              {`Descrição do Cargo: ${Descricao}`}
            </p>
          </h4>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  Nome: state.Nome,
  Email: state.Email,
  Cpf: state.Cpf,
  Endereco: state.Endereco,
  Cidade: state.Cidade,
  estado: state.estado,
  Curriculo: state.Curriculo,
  Cargo: state.Cargo,
  Descricao: state.Descricao,
});

export default connect(mapStateToProps)(FormDataDisplay);
